import React, { useState } from 'react';

function Contact() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [service, setService] = useState('');
  const [message, setMessage] = useState('');
  const [sendCopy, setSendCopy] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    // handle form submission logic here
    console.log('Form submitted:', name, email, phone, service, message, sendCopy);
  };

  return (
    <div className="contact-section">
      <div className="contact-info">
        <h2>Contact Information</h2>
        <p>Email: email@email.com</p>
        <p>Phone: 555-555-5555</p>
        <p>Based in Virginia</p>
      </div>
      <div className="contact-form">
        <h2>Request an Estimate</h2>
        <form onSubmit={handleSubmit}>
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" value={name} onChange={(e) => setName(e.target.value)} />

          <label htmlFor="email">Email:</label>
          <input type="email" id="email" value={email} onChange={(e) => setEmail(e.target.value)} />

          <label htmlFor="phone">Phone Number:</label>
          <input type="tel" id="phone" value={phone} onChange={(e) => setPhone(e.target.value)} />

          <label htmlFor="service">Service needed:</label>
          <select id="service" value={service} onChange={(e) => setService(e.target.value)}>
            <option value="">Select a service...</option>
            <option value="option1">Option 1</option>
            <option value="option2">Option 2</option>
            <option value="option3">Option 3</option>
            <option value="option4">Option 4</option>
            <option value="option5">Option 5</option>
            <option value="option6">Option 6</option>
          </select>

          <label htmlFor="message">Message:</label>
          <textarea id="message" value={message} onChange={(e) => setMessage(e.target.value)}></textarea>

          <label htmlFor="sendCopy">
            <input type="checkbox" id="sendCopy" checked={sendCopy} onChange={(e) => setSendCopy(e.target.checked)} />
            Send me a copy of this message
          </label>

          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
}

export default Contact;
